import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
    return (
        <div className='nav'>
            <Link to='/' className='nav-link'></Link>
            <Link to="/about" className='nav-link'>About</Link>
            <Link to="/shop" className='nav-link'>Shop</Link>        
        </div>
    );
};

export default NavBar;
